import React, { useState } from "react";

const VQAForm = () => {
  const [file, setFile] = useState(null);
  const [preview, setPreview] = useState(null);
  const [question, setQuestion] = useState("");
  const [answer, setAnswer] = useState("");
  const [confidence, setConfidence] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleFileChange = (e) => {
    const selectedFile = e.target.files[0];
    setFile(selectedFile);
    if (selectedFile) {
      const reader = new FileReader();
      reader.onloadend = () => setPreview(reader.result);
      reader.readAsDataURL(selectedFile);
    } else setPreview(null);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!file || !question) return alert("Please upload an image and enter a question.");

    const formData = new FormData();
    formData.append("image", file);
    formData.append("question", question);

    setLoading(true);
    setAnswer("");
    setConfidence(null);

    try {
      const res = await fetch("http://localhost:8000/vqa/", { method: "POST", body: formData });
      if (!res.ok) throw new Error(`Server error: ${res.status}`);
      const data = await res.json();
      setAnswer(data.answer);
      setConfidence(data.confidence ?? null);
    } catch (err) {
      console.error(err);
      setAnswer("Error processing request");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <input type="file" accept="image/*" onChange={handleFileChange} />
        <input type="text" placeholder="Enter your question" value={question} onChange={(e) => setQuestion(e.target.value)} />
        <button type="submit">Ask</button>
      </form>
      {preview && <img src={preview} alt="Preview" style={{ maxWidth: "300px" }} />}
      {loading && <p>Processing...</p>}
      {answer && !loading && (
        <div>
          <p><strong>Answer:</strong> {answer}</p>
          {confidence !== null && <p>{Math.round(confidence*100)}% confident</p>}
        </div>
      )}
    </div>
  );
};

export default VQAForm;

